import React from "react";
import HomePresenter from "./HomePresenter";

export default class extends React.Component {
  handleSubmit = (event) => {
    event.preventDefault();
    const { searchTerm } = this.state;
    if (searchTerm !== "") {
      this.searchByTerm();
    }
  };
  render() {
    return <HomePresenter />;
  }
}
